/*
 *  Push OpenGL bindings to JavaScript global object
 */
void duk_gl_push_opengl_bindings(duk_context *ctx)
{
	duk_push_global_object(ctx);
	duk_gl_bind_opengl_functions(ctx);
	duk_gl_set_constants(ctx);
	duk_pop(ctx);
}

